import { IconPhoto, IconPrinter, IconCameraSelfie } from "@tabler/icons-react";
import { Accordion, Container, rem } from "@mantine/core";

const SideAppBar = () => {
  return (
    <Container>
      <Accordion variant="contained">
        <Accordion.Item value="photos">
          <Accordion.Control
            icon={
              <IconPhoto
                style={{
                  color: "var(--mantine-color-red-filled",
                  width: rem(20),
                  height: rem(20),
                }}
              />
            }
          >
            Recent photos
          </Accordion.Control>
          <Accordion.Panel>Content</Accordion.Panel>
        </Accordion.Item>

        <Accordion.Item value="print">
          <Accordion.Control
            icon={
              <IconPrinter
                style={{
                  color: "var(--mantine-color-blue-filled",
                  width: rem(20),
                  height: rem(20),
                }}
              />
            }
          >
            Print photos
          </Accordion.Control>
          <Accordion.Panel>Content</Accordion.Panel>
        </Accordion.Item>

        <Accordion.Item value="camera">
          <Accordion.Control
            icon={
              <IconCameraSelfie
                style={{
                  color: "var(--mantine-color-teal-filled)",
                  width: rem(20),
                  height: rem(20),
                }}
              />
            }
          >
            Camera settings
          </Accordion.Control>
          <Accordion.Panel>Content</Accordion.Panel>
        </Accordion.Item>
      </Accordion>
    </Container>
  );
};

export default SideAppBar;
